import React from 'react';
import ReactDom from 'react-dom'
import Card from './App.jsx'
import './index.css'
import Ldata from './Links'

ReactDom.render(
  <>
    <h1 className="heading">List of top 5 web series in 2021</h1>

    <Card
      imgPoster={Ldata[0].imgPoster}
      title={Ldata[0].title}
      name={Ldata[0].title}
      link={Ldata[0].title}
    />
    <Card
      imgPoster={Ldata[1].imgPoster}
      title={Ldata[1].title}
      name={Ldata[1].title}
      link={Ldata[1].title}
    />
    <Car1
      imgPoster={Ldata[2].imgPoster}
      title={Ldata[2].title}
      name={Ldata[2].title}
      link={Ldata[2].title}
    />
    <Card
      imgPoster={Ldata[3].imgPoster}
      title={Ldata[3].title}
      name={Ldata[3].title}
      link={Ldata[3].title}
    />
    <Card
      imgPoster={Ldata[4].imgPoster}
      title={Ldata[4].title}
      name={Ldata[4].title}
      link={Ldata[4].title}
    />


  </>,
  document.getElementById("root")
)
